function UserPage() {
    return (
        <main className="user-container">
            <div className="usertable">
                <table className="table table-hover  table-striped  mx-auto bg-warning">
                    <thead>
                        <tr>
                            <th scope="col">#</th>
                            <th scope="col">Name</th>
                            <th scope="col">Prise</th>

